import axios from "axios";
import { API_KEY } from "keysConfig.js";
import React, { useState } from "react";

export default {
  async getData() {
    let res, lat, long;

    try {

      if (navigator.geolocation) {
        console.log(navigator)
        lat = navigator.geolocation.getCurrentPosition.coords.latitude;
        long = navigator.geolocation.getCurrentPosition.coords.longitude;
        console.log(lat, long);
        res = await axios.get(
          `https://api.darksky.net/forecast/${API_KEY}/[latitude],[longitude]`
        );
      } else {
        console.log("no user allow");
      }

      return res;
    } catch (error) {
      return error;
    }
  },
};
